export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:e,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:a,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:a,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:a,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:e,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}},{id:2784,attributes:{type:a,item_lang:{data:{id:3451,attributes:{title:"Renfield",slug:"renfield"}}}}},{id:2788,attributes:{type:a,item_lang:{data:{id:3455,attributes:{title:"The Killer",slug:"the-killer"}}}}},{id:2790,attributes:{type:a,item_lang:{data:{id:3457,attributes:{title:"The Color Purple",slug:"the-color-purple"}}}}},{id:2798,attributes:{type:e,item_lang:{data:{id:3465,attributes:{title:"Silo",slug:"silo"}}}}},{id:2802,attributes:{type:e,item_lang:{data:{id:3469,attributes:{title:"The Night Agent",slug:"the-night-agent"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:10}}},Njq7bcN4XQ:{data:{id:2786,attributes:{imdbId:"tt12672536",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZGM1NjE5MzQtMmNiYy00ZWIxLWFiMGUtMzE1N2EzNzY0MjY0XkEyXkFqcGdeQXVyMTUzMTUxMzk1._V1_SX300.jpg",type:a,ratings:[{Source:"Internet Movie Database",Value:"7.1\u002F10"}],item_lang:{data:{id:3453,attributes:{title:"The Three Musketeers: D'Artagnan",plot:"D'Artagnan arrives in Paris trying to find his attackers after being left for dead, which leads him to a real war where the future of France is at stake. He aligns himself with Athos, Porthos and Aramis, three musketeers of the King.",slug:"the-three-musketeers-dartagnan"}}},books:{data:[{id:13262,attributes:{title:f,description:"The official TV tie-in to the brand new adaptation on BBC One -- full of epic adventure and with a new translation. A young Gascon gentleman, D'Artagnan, arrives in Paris determined to join the infamous King''s guards and is soon befriended by the band of musketeers, Athos, Porthos and Aramis famed for their impressive swordplay and fearless spirit. With the treacherous Cardinal Richelieu and his seductive spy, Milady, weaving a web of deceit and royal intrigue, the friends are soon drawn into an evil plot. To defend the Queen's honour and protect the King they must discover the truth, encountering stolen diamonds, Louis XIII, love, murder and vengeance along the way. A swashbuckling tale of chivalry, romance, daring rooftop duels and most of all, adventure.",thumbnail:"http:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=muM-nwEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:c,published:"2014-01-01",publisher:"BBC Books",subtitle:d}},{id:13263,attributes:{title:f,description:"Set in 1625, \"The Three Musketeers\" recounts the adventures of a young man named d'Artagnan after he leaves home to travel to Paris, to join the Musketeers of the Guard. Although D'Artagnan is not able to join this elite corps immediately, he befriends the three most formidable musketeers of the age: Athos, Porthos and Aramis and gets involved in affairs of the state and court. Dumas frequently works into the plot various injustices, abuses and absurdities of the old regime, giving the story an additional political aspect at a time when the debate in France between republicans and monarchists was still fierce. The novel Twenty Years After follows events in France during the Fronde, during the childhood reign of Louis XIV. The musketeers are valiant and just in their efforts to protect young Louis XIV and the doomed Charles I from their attackers. The Vicomte de Bragelonne, Louise de la Vallière and The Man in the Iron Mask are set between 1660 and 1667 against the background of the transformation of Louis XIV from child monarch to Sun King. Alexandre Dumas, père (1802-1870) was a French writer whose works have been translated into nearly 100 languages and he is one of the most widely read French authors. His most famous works are The Count of Monte Cristo and The Three Musketeers.",thumbnail:"http:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=qkaVEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2022-11-13",publisher:"DigiCat",subtitle:"All 3 Books"}},{id:13264,attributes:{title:f,description:"One of the preeminent novels by French writer Alexandre Dumas, this swashbuckling tale follows a group of honorable 17th-century swordsmen who must contend with powerful adversaries scheming against the queen. Determined to join the royal guard, young d'Artagnan leaves his country home and travels to Paris, where he unintentionally angers Aramis, Athos, and Porthos, the esteemed Three Musketeers. Eventually winning the trust and admiration of the formidable trio of fighters, d'Artagnan joins them in their quest to thwart the plans of the sinister Cardinal Richelieu.",thumbnail:"http:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=KW0YAAAAYAAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"1878-01-01",publisher:d,subtitle:d}},{id:13265,attributes:{title:"The Three Musketeers - Alexandre Dumas",description:"The Three Musketeers (Les Trois Mousquetaires) is a novel by Alexandre Dumas, père. It recounts the adventures of a young man named d'Artagnan after he leaves home to become a musketeer. D'Artagnan is not one of the musketeers of the title; those are his friends Athos, Porthos, and Aramisinseparable friends who live by the motto, \"One for all, and all for one\".The story of d'Artagnan is continued in Twenty Years After and The Vicomte de Bragelonne. Those three novels by Dumas are together known as the D'Artagnan Romances.The Three Musketeers was first published in serial form in the magazine Le Siècle between March and July 1844.",thumbnail:"http:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=MF4wEAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"2021-06-10",publisher:"Phoemixx Classics Ebooks",subtitle:d}},{id:13266,attributes:{title:"The Three Musketeers : Om Illustrated Classics",description:"All D’artagnan ever wanted was to one day become a part of the French King, Louis XIII majestic Musketeers. And when he is befriended by Athos, Porthos and Aramis, three of the King’s most able Musketeers, D’artagnan finally feels like he is on the right path. But trouble comes calling. Suddenly, France is caught in a political conspiracy at the hands of the powerful, Cardinal Richelieu. The Cardinal has come up with an evil plan to humiliate the King’s wife, Queen Anne, in an attempt to snatch the throne of France and take over the reins of the country. Now, D’artagnan and the Three Musketeers must fight against the Cardinal’s sinister schemes, even as the threat of war looms large over France. The Three Musketeers and their young friend have to stop the evil forces and save France from falling into the wrong hands. Together they fight, and stay victorious, and keep alive. They are -- “One for all, and all for one!”",thumbnail:"http:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=YfrDDAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:c,published:"1000-01-01",publisher:"Om Books International",subtitle:d}}]}}},meta:{}}},prerenderedAt:1694069404451}}("movie","Alexandre Dumas",true,"","series","The Three Musketeers",1))